import React, { useEffect } from 'react';
import './About.css';
import ProgressBar from 'progressbar.js';

const About = () => {
  useEffect(() => {
    // Initialize progress bars after component mounts
    const htmlProgress = new ProgressBar.Circle('.html-progress', {
      color: '#831515',
      strokeWidth: 8,
      trailWidth: 8,
      trailColor: '#2e3035',
      duration: 1400,
      easing: 'easeInOut',
    });

    htmlProgress.animate(0.9); // 90% for HTML

    const cssProgress = new ProgressBar.Circle('.css-progress', {
      color: '#831515',
      strokeWidth: 2,
      trailWidth: 5,
      trailColor: '#2e3035',
      duration: 1400,
      easing: 'easeInOut',
    });

    cssProgress.animate(0.85); // 85% for CSS

    const phpProgress = new ProgressBar.Circle('.php-progress', {
      color: '#831515',
      strokeWidth: 8,
      trailWidth: 8,
      trailColor: '#2e3035',
      duration: 1400,
      easing: 'easeInOut',
    });

    phpProgress.animate(0.8); // 80% for PHP

    const jqueryProgress = new ProgressBar.Circle('.jquery-progress', {
      color: '#831515',
      strokeWidth: 8,
      trailWidth: 8,
      trailColor: '#2e3035',
      duration: 1400,
      easing: 'easeInOut',
    });

    jqueryProgress.animate(0.75); // 75% for jQuery

    return () => {
      // Cleanup on component unmount
      htmlProgress.destroy();
      cssProgress.destroy();
      phpProgress.destroy();
      jqueryProgress.destroy();
    };
  }, []);

  return (
    <section id="section-about" className="about-section">
      <div className="container">
        <div className="row">
          <div className="col-md-12 text-center">
            <h2>About Me</h2>
            <div className="space-border"></div>
          </div>
          <div className="col-md-8 offset-md-2 text-center">
            <p>I am a website designer from Louisiana, with a strong focus in UI/UX design. I love to get new experiences and always learn from my surroundings. I've done more than 285 projects. You can check them out in my portfolio section. I look forward to any opportunities and challenges.</p>
          </div>
          <div className="spacer-single"></div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar html-progress">
              <canvas width="200" height="200"></canvas>
              <div>90.0%</div>
            </div>
            <h4>HTML</h4>
          </div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar css-progress">
              <canvas width="200" height="200"></canvas>
              <div>85.0%</div>
            </div>
            <h4>CSS</h4>
          </div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar php-progress">
              <canvas width="200" height="200"></canvas>
              <div>80.0%</div>
            </div>
            <h4>PHP</h4>
          </div>
          <div className="col-lg-3 position-relative">
            <div className="progressbar jquery-progress">
              <canvas width="200" height="200"></canvas>
              <div>75.0%</div>
            </div>
            <h4>jQuery</h4>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
